const gatotLogo = "data:image/png;base64,"
const favicon = "data:image/png;base64,"
const buttonContainer = document.querySelector('.CqAVzb.lJ9FBc');
const searchButtons = document.querySelectorAll('center>[type="submit"]:first-child');
const luckyButtons = document.querySelectorAll('center>[type="submit"]:last-child');
const subText = document.querySelector('#SIvCob')
const searchText = "Saatnya Menggatot";

const logo = document.querySelector('img[alt="Google"]');

document.title = "GATOT"

// change favicon
var link = document.querySelector("link[rel~='icon']");
if (!link) {
    link = document.createElement('link');
    link.rel = 'icon';
    document.getElementsByTagName('head')[0].appendChild(link);
}
link.href = favicon;

logo.src = gatotLogo;
logo.removeAttribute("srcset");
searchButtons.forEach((searchButton) => {
    searchButton.value = searchText;
    searchButton.innerHTML  = searchText;
    searchButton.innerText  = searchText;
    searchButton.textContent  = searchText;
    searchButton.style.cssText = `
    padding: clamp(2rem, calc(1vw + 1rem), 3rem);
    font-size: clamp(2rem, calc(1vw + 1rem), 3rem);
    height: unset;
    border-radius: 50px;
    text-transform: uppercase;
    `;
});

//menghilangkan tombol pencarian random karna judi itu haram, tapi zeus cuman mainan kartu doang 
luckyButtons.forEach((searchButton) => {
    searchButton.remove();
});

subText.innerText= "";
subText.style.cssText = `
margin: 0 auto;
margin-top: clamp(1rem, calc(2vw + 1rem), 3rem);
`

buttonContainer.style.cssText = `
height: unset;
`

document.body.style.backgroundImage = "url('https://obs.line-scdn.net/0hJAvDhHWbFW5LPQGtaQRqOXNrGR94Ww9naQhZW2ZuT1o2EVYxJw9GDWc4QkI1BQZqawxSAG5uHlg0WgA5JA/w644')";